function startCountdown($,t){let o=document.getElementById(t),n=setInterval(function(){let t=new Date,e=new Date($)-t;e<=0?(clearInterval(n),o.textContent="00d 00h 00m 00s"):o.textContent=`${Math.floor(e/864e5)}d ${Math.floor(e%864e5/36e5)}h ${Math.floor(e%36e5/6e4)}m ${Math.floor(e%6e4/1e3)}s`},1e3)}